import React, { useEffect, useState } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { fetchAllHealthTopics } from "apiRequests/common";
import { DataGrid } from "@material-ui/data-grid";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardMedia from "@material-ui/core/CardMedia";
// import { Avatar } from "@material-ui/core";

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
  media: {
    padding: "1rem",
    height: "140px",
    width: "150px",
  },
});

const AdminHealthTopics = ({ fetchAllHealthTopics, healthTopics }) => {
  const [rows, setRows] = useState([]);
  const [columns, setColumns] = useState([]);
  const classes = useStyles();

  useEffect(() => {
    fetchAllHealthTopics();
  }, []);
  useEffect(() => {
    setColumns(getColumnData());
    setRows(healthTopics);
  }, [healthTopics]);

  const getColumnData = () => [
    { field: "healthTopicId", hide: true },
    {
      field: "picture",
      headerName: "Picture",
      width: 300,
      padding: "1rem",
      renderCell: function renderImage(params) {
        console.log("---------params-------", params);
        return (
          <Card className={classes.root}>
            <CardActionArea>
              <CardMedia
                className={classes.media}
                image={params.value}
                title="Contemplative Reptile"
              />
            </CardActionArea>
          </Card>
        );
      },
    },
    { field: "title", headerName: "Title", width: 300 },
  ];
  console.log(rows, columns);
  return (
    <div
      style={{
        autoHeight: 500,
        width: "60%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <DataGrid
        rowHeight={100}
        rows={rows}
        columns={columns}
        pageSize={5}
        getRowId={(row) => row.healthTopicId}
      />
    </div>
  );
};

AdminHealthTopics.propTypes = {
  fetchAllHealthTopics: PropTypes.func.isRequired,
  healthTopics: PropTypes.array,
};

const mapStateToProps = (state) => {
  return {
    healthTopics: state.common.healthTopics,
  };
};

const mapDispatchToProps = (dispatch) => ({
  fetchAllHealthTopics: () => dispatch(fetchAllHealthTopics()),
});

export default connect(mapStateToProps, mapDispatchToProps)(AdminHealthTopics);
